import React from 'react';


function GridListItem() {
  const {id, title, author} = this.props;
  <GridListTile key={id}>
    <img src={`/images/restaurants/${id}.jpg`} alt={title} />
    <GridListTileBar
      title={title}
      subtitle={<span>by: {author}</span>}
      actionIcon={
        <IconButton className="icon">
          <InfoIcon />
        </IconButton>
      }
    />
  </GridListTile>
}

export default GridListItem;
